#
# Definition for the `zms` view : 
#

DROP VIEW IF EXISTS `zms`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` SQL SECURITY DEFINER VIEW `zms` AS (
  select 
    `t_user`.`ID` AS `ID`,
    `t_user`.`EmployeeNo` AS `EmployeeNo`,
    `t_user`.`EmployeeName` AS `EmployeeName`,
    `t_user`.`Department` AS `Department`,
    `t_user`.`Section` AS `Section`,
    `t_user`.`Title` AS `Title`,
    `t_user`.`ContractTerms` AS `ContractTerms`,
    `t_user`.`JoinDate` AS `JoinDate`,
    `t_user`.`ContractStartDate` AS `ContractStartDate`,
    `t_user`.`ContractEndDate` AS `ContractEndDate`,
    `t_user`.`ProbationCompleteDate` AS `ProbationCompleteDate`,
    `t_user`.`MobilePhone` AS `MobilePhone`,
    `t_user`.`DateofBirth` AS `DateofBirth`,
    `t_user`.`Sex` AS `Sex` 
  from 
    `t_user` 
  where 
    ((month(now()) = month(`t_user`.`DateofBirth`)) and (dayofmonth(now()) = dayofmonth(`t_user`.`DateofBirth`))));

#
# Definition for the `zms2` view : 
#

DROP VIEW IF EXISTS `zms2`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `zms2` AS (
  select 
    `t_user`.`ID` AS `ID`,
    `t_user`.`EmployeeNo` AS `EmployeeNo`,
    `t_user`.`EmployeeName` AS `EmployeeName`,
    `t_user`.`Department` AS `Department`,
    `t_user`.`Section` AS `Section`,
    `t_user`.`Title` AS `Title`,
    `t_user`.`ContractTerms` AS `ContractTerms`,
    `t_user`.`JoinDate` AS `JoinDate`,
    `t_user`.`ContractStartDate` AS `ContractStartDate`,
    `t_user`.`ContractEndDate` AS `ContractEndDate`,
    `t_user`.`ProbationCompleteDate` AS `ProbationCompleteDate`,
    `t_user`.`MobilePhone` AS `MobilePhone`,
    `t_user`.`DateofBirth` AS `DateofBirth`,
    `t_user`.`Sex` AS `Sex`,
    `t_user`.`serviceyears` AS `serviceyears` 
  from 
    `t_user` 
  where 
    ((month(now()) = month(`t_user`.`JoinDate`)) and (dayofmonth(now()) = dayofmonth(`t_user`.`JoinDate`))));

